    <script>
      const startTime = performance.now();

      function globalPlay() {
        mainComposition.play();
      }

      function globalStop() {

      /**
       * https://github.com/gre/bezier-easing
       * BezierEasing - use bezier curve for transition easing function
       * by Gaëtan Renaudeau 2014 - 2015 – MIT License
       */

      // These values are established by empiricism with tests (tradeoff: performance VS precision)
      var NEWTON_ITERATIONS = 4;
      var NEWTON_MIN_SLOPE = 0.001;
      var SUBDIVISION_PRECISION = 0.0000001;
      var SUBDIVISION_MAX_ITERATIONS = 10;

      var kSplineTableSize = 11;
      var kSampleStepSize = 1.0 / (kSplineTableSize - 1.0);

      var float32ArraySupported = typeof Float32Array === 'function';

      function A(aA1, aA2) {
        return 1.0 - 3.0 * aA2 + 3.0 * aA1;
      }

      function B(aA1, aA2) {
        return 3.0 * aA2 - 6.0 * aA1;
      }

      function C(aA1) {
        return 3.0 * aA1;
      }

      // Returns x(t) given t, x1, and x2, or y(t) given t, y1, and y2.
      function calcBezier(aT, aA1, aA2) {
        return ((A(aA1, aA2) * aT + B(aA1, aA2)) * aT + C(aA1)) * aT;
      }

      // Returns dx/dt given t, x1, and x2, or dy/dt given t, y1, and y2.
      function getSlope(aT, aA1, aA2) {
        return 3.0 * A(aA1, aA2) * aT * aT + 2.0 * B(aA1, aA2) * aT + C(aA1);
      }

      function binarySubdivide(aX, aA, aB, mX1, mX2) {
        var currentX, currentT, i = 0;
        do {
          currentT = aA + (aB - aA) / 2.0;
          currentX = calcBezier(currentT, mX1, mX2) - aX;
          if (currentX > 0.0) {
            aB = currentT;
          } else {
            aA = currentT;
          }
        } while (Math.abs(currentX) > SUBDIVISION_PRECISION && ++i < SUBDIVISION_MAX_ITERATIONS);
        return currentT;
      }

      function newtonRaphsonIterate(aX, aGuessT, mX1, mX2) {
        for (var i = 0; i < NEWTON_ITERATIONS; ++i) {
          var currentSlope = getSlope(aGuessT, mX1, mX2);
          if (currentSlope === 0.0) {
            return aGuessT;
          }
          var currentX = calcBezier(aGuessT, mX1, mX2) - aX;
          aGuessT -= currentX / currentSlope;
        }
        return aGuessT;
      }

      function LinearEasing(x) {
        return x;
      }

      function bezier(mX1, mY1, mX2, mY2) {
        if (!(0 <= mX1 && mX1 <= 1 && 0 <= mX2 && mX2 <= 1)) {
          throw new Error('bezier x values must be in [0, 1] range');
        }

        if (mX1 === mY1 && mX2 === mY2) {
          return LinearEasing;
        }

        // Precompute samples table
        var sampleValues = float32ArraySupported ? new Float32Array(kSplineTableSize) : new Array(kSplineTableSize);
        for (var i = 0; i < kSplineTableSize; ++i) {
          sampleValues[i] = calcBezier(i * kSampleStepSize, mX1, mX2);
        }

        function getTForX(aX) {
          var intervalStart = 0.0;
          var currentSample = 1;
          var lastSample = kSplineTableSize - 1;

          for (; currentSample !== lastSample && sampleValues[currentSample] <= aX; ++currentSample) {
            intervalStart += kSampleStepSize;
          }
          --currentSample;

          // Interpolate to provide an initial guess for t
          var dist = (aX - sampleValues[currentSample]) / (sampleValues[currentSample + 1] - sampleValues[currentSample]);
          var guessForT = intervalStart + dist * kSampleStepSize;

          var initialSlope = getSlope(guessForT, mX1, mX2);
          if (initialSlope >= NEWTON_MIN_SLOPE) {
            return newtonRaphsonIterate(aX, guessForT, mX1, mX2);
          } else if (initialSlope === 0.0) {
            return guessForT;
          } else {
            return binarySubdivide(aX, intervalStart, intervalStart + kSampleStepSize, mX1, mX2);
          }
        }

        return function BezierEasing(x) {
          // Because JavaScript number are imprecise, we should guarantee the extremes are right.
          if (x === 0) {
            return 0;
          }
          if (x === 1) {
            return 1;
          }
          return calcBezier(getTForX(x), mY1, mY2);
        };
      };

      function getPathD(frame, points, isClosed) {
        if (!points) {
          console.error("Points are undefined, can not generate path d");
          return '';
        }
        const firstPoint = points[0];
        if (!firstPoint) {
          return '';
        }

        const d = 'M ' + firstPoint.mainPoint.x.getValueAtFrame(frame) + ' ' + firstPoint.mainPoint.y.getValueAtFrame(frame) + ' ' + getPathDCore(frame, points, isClosed);
        return d;
      }

      function getAbsolutePathD(frame, points, isClosed, parentX, parentY) {
        const d = 'M ' + (points[0].mainPoint.x.getValueAtFrame(frame) + parentX) + ' ' + (points[0].mainPoint.y.getValueAtFrame(frame) + parentY) + ' ' + this.getPathDCore(frame, points, isClosed);
        return d;
      }

      function getInversedPathD(frame, points, isClosed, parentX, parentY) {
        const mpx = points[0].mainPoint.x.getValueAtFrame(frame) + parentX;
        const mpy = points[0].mainPoint.y.getValueAtFrame(frame) + parentY;

        const firstPointX = points[1].mainPoint.x.getValueAtFrame(frame);
        const firstPointY = points[1].mainPoint.y.getValueAtFrame(frame);
        const lastPointX = points[points.length - 1].mainPoint.x.getValueAtFrame(frame);
        const lastPointY = points[points.length - 1].mainPoint.y.getValueAtFrame(frame);

        /**
         * Important for detecting in which "order" to draw path, for cutting inner shape out
         */
        let d = '';
        if (firstPointX < lastPointX && firstPointY > lastPointY) {
          d = 'M 0 0 c 0 0, 2000 0, 2000 0 c 0 0, 0 2000, 0 2000 c 0 0, -2000 0, -2000 0 c 0 0, 0 -2000, 0 -2000 c 0 0, ';
        } else {
          d = 'M 0 0 c 0 0, 0 2000, 0 2000 c 0 0, 2000 0, 2000 0 c 0 0, 0 -2000, 0 -2000 c 0 0, -2000 0, -2000 0 c 0 0, ';
        }

        d += '0 ' + mpy + ', 0 ' + mpy + ' c 0 0, ' + mpx + ' 0, ' + mpx + ' 0 ';
        d += getPathDCore(frame, points, isClosed);

        return d;
      }

      function getPathDCore(frame, points, isClosed) {
        let pathD = '';

        /**
         * Iterate as long as there are neighbours.
         */
        for (let i = 0; i < points.length - 1; i++) {
          const prevPoint = points[i - 1];
          const currentPoint = points[i];
          const nextPoint = points[i + 1];

          /**
           * Convert current and next point's position to be relative to previous points.
           * This is important because SVG path D parameter is set to work this way.
           */
          const currentPointRelativeToPreviousPoint = {
            x: currentPoint.mainPoint.x.getValueAtFrame(frame),
            y: currentPoint.mainPoint.y.getValueAtFrame(frame),
          };
          if (prevPoint) {
            currentPointRelativeToPreviousPoint.x -= prevPoint.mainPoint.x.getValueAtFrame(frame);
            currentPointRelativeToPreviousPoint.y -= prevPoint.mainPoint.y.getValueAtFrame(frame);
          }
          const nextPointRelativeToCurrentPoint = {
            x: nextPoint.mainPoint.x.getValueAtFrame(frame) - currentPoint.mainPoint.x.getValueAtFrame(frame),
            y: nextPoint.mainPoint.y.getValueAtFrame(frame) - currentPoint.mainPoint.y.getValueAtFrame(frame),
          };


          /**
           * If C does not exist - take 0 as deltas for C.
           * That will form straight line.
           */
          const currentOutCX = currentPoint.outC ? currentPoint.outC.x.getValueAtFrame(frame) : 0;
          const currentOutCY = currentPoint.outC ? currentPoint.outC.y.getValueAtFrame(frame) : 0;
          const nextInCX = nextPoint.inC ? nextPoint.inC.x.getValueAtFrame(frame) : 0;
          const nextInCY = nextPoint.inC ? nextPoint.inC.y.getValueAtFrame(frame) : 0;

          /**
           * Convert next point's C IN point to be relative to current point.
           */
          const distanceBetweenPointsX = nextPointRelativeToCurrentPoint.x - currentPointRelativeToPreviousPoint.x;
          const distanceBetweenPointsY = nextPointRelativeToCurrentPoint.y - currentPointRelativeToPreviousPoint.y;
          const nextInCXRelativeToCurrent = currentPointRelativeToPreviousPoint.x + distanceBetweenPointsX + nextInCX;
          const nextInCYRelativeToCurrent = currentPointRelativeToPreviousPoint.y + distanceBetweenPointsY + nextInCY;

          /**
           * Take current point's C OUT and next point's C in coordinates.
           */
          pathD += 'c ' + currentOutCX + ' ' + currentOutCY + ', ' + nextInCXRelativeToCurrent + ' ' + nextInCYRelativeToCurrent + ', ' + nextPointRelativeToCurrentPoint.x + ' ' + nextPointRelativeToCurrentPoint.y + ' ';
        }

        /**
         * * If path is closed
         * then need to simulate path close point.
         */
        if (isClosed) {
          const firstPoint = points[0];
          const lastPoint = points[points.length - 1];

          if (firstPoint && lastPoint) {
            const diffBetweenFirstAndLastX = lastPoint.mainPoint.x.getValueAtFrame(frame) - firstPoint.mainPoint.x.getValueAtFrame(frame);
            const diffBetweenFirstAndLastY = lastPoint.mainPoint.y.getValueAtFrame(frame) - firstPoint.mainPoint.y.getValueAtFrame(frame);

            let lastPointCOut = {
              x: 0,
              y: 0
            };
            if (lastPoint.outC) {
              lastPointCOut = {
                x: lastPoint.outC.x.getValueAtFrame(frame),
                y: lastPoint.outC.y.getValueAtFrame(frame),
              };
            }

            /**
             * Convert first point's C IN point to be relative to last point
             */
            let firstCIn = {
              x: 0,
              y: 0
            };
            if (firstPoint.inC) {
              firstCIn.x = firstPoint.mainPoint.x.getValueAtFrame(frame) - lastPoint.mainPoint.x.getValueAtFrame(frame) + firstPoint.inC.x.getValueAtFrame(frame);
              firstCIn.y = firstPoint.mainPoint.y.getValueAtFrame(frame) - lastPoint.mainPoint.y.getValueAtFrame(frame) + firstPoint.inC.y.getValueAtFrame(frame);
            }

            pathD += 'c ' + lastPointCOut.x + ' ' + lastPointCOut.y + ', ' + firstCIn.x + ' ' +
              firstCIn.y +
              ', ' + -diffBetweenFirstAndLastX + ' ' + -diffBetweenFirstAndLastY + ' ';
            pathD += 'Z';
          }
        }
        return pathD;
      }

      function colorConverter(hex) {
        let fakeDiv = document.createElement('div');
        fakeDiv.style.color = hex;
        document.body.appendChild(fakeDiv);

        const cs = window.getComputedStyle(fakeDiv);
        const colorString = cs.getPropertyValue('color');

        document.body.removeChild(fakeDiv);

        const [r, g, b, a] = colorString.substring(colorString.indexOf('(') + 1, colorString.lastIndexOf(')')).split(/,s*/);
        return {
          r: parseFloat(r),
          g: parseFloat(g),
          b: parseFloat(b),
          a: a ? parseFloat(a) : 1,
        };
      }

      function getMaskPathDForRectangle(x, y, width, height, transformOriginX, transformOriginY) {
        const topLeftX = x - width / 2 - transformOriginX;
        const topLeftY = y - height / 2 - transformOriginY;
        const topRightX = x + width / 2 - transformOriginX;
        const topRightY = topLeftY;
        const bottomRightX = topRightX;
        const bottomRightY = y + height / 2 - transformOriginY;
        const bottomLeftX = x - width / 2 - transformOriginX;
        const bottomLeftY = bottomRightY;

        const d = "M " + topLeftX + " " + topLeftY + " L " + topRightX + "," + topRightY + " L " + bottomRightX + "," + bottomRightY + " L " + bottomLeftX + "," + bottomLeftY + " z";
        return d;
      }

      function getMaskPolygonForRectangle(x, y, width, height, transformOriginX, transformOriginY) {
        function setPx(value) {
          return value + "px";
        }

        const polygonItems = [];
        polygonItems.push([setPx(x - width / 2), setPx(y - height / 2)].join(" "));
        polygonItems.push([setPx(x + width / 2), setPx(y - height / 2)].join(" "));
        polygonItems.push([setPx(x + width / 2), setPx(y + height / 2)].join(" "));
        polygonItems.push([setPx(x - width / 2), setPx(y + height / 2)].join(" "));

        const polygon = polygonItems.join(",");
        return polygon;
      }

      function getPathDForRectangle(width, height, topLeft, topRight, bottomRight, bottomLeft) {
        // Ensure radii do not exceed half the width/height
        topLeft = Math.min(topLeft, width / 2, height / 2);
        topRight = Math.min(topRight, width / 2, height / 2);
        bottomRight = Math.min(bottomRight, width / 2, height / 2);
        bottomLeft = Math.min(bottomLeft, width / 2, height / 2);

        return [
          // Start at top-left corner
          `M ${topLeft},0`,

          // Line to top-right corner
          `H ${width - topRight}`,
          // Arc to right-top corner
          `A ${topRight},${topRight} 0 0 1 ${width},${topRight}`,

          // Line to bottom-right corner
          `V ${height - bottomRight}`,
          // Arc to right-bottom corner
          `A ${bottomRight},${bottomRight} 0 0 1 ${width - bottomRight},${height}`,

          // Line to bottom-left corner
          `H ${bottomLeft}`,
          // Arc to left-bottom corner
          `A ${bottomLeft},${bottomLeft} 0 0 1 0,${height - bottomLeft}`,

          // Line to top-left corner
          `V ${topLeft}`,
          // Arc to left-top corner
          `A ${topLeft},${topLeft} 0 0 1 ${topLeft},0`,

          'Z',
        ].join(' ');
      }

      function getPathDForEllipse(width, height, x, y) {
        const safeX = x === undefined ? 0 : x;
        const safeY = y === undefined ? 0 : y;
        const kappa = 0.5522847498;

        const cx = width / 2 + safeX;
        const cy = height / 2 + safeY;
        const rx = width / 2;
        const ry = height / 2;

        const ox = rx * kappa; // x offset for the control point
        const oy = ry * kappa; // y offset for the control point

        let d = `M${cx - rx}, ${cy}`;
        d += `C${cx - rx}, ${cy - oy}, ${cx - ox}, ${cy - ry}, ${cx}, ${cy - ry},`;
        d += `C${cx + ox}, ${cy - ry}, ${cx + rx}, ${cy - oy}, ${cx + rx}, ${cy},`;
        d += `C${cx + rx}, ${cy + oy}, ${cx + ox}, ${cy + ry}, ${cx}, ${cy + ry},`;
        d += `C${cx - ox}, ${cy + ry}, ${cx - rx}, ${cy + oy}, ${cx - rx}, ${cy},`;
        d += `z`;
        return d;
      }

      function getMaskPathDForEllipse(x, y, width, height) {
        return getPathDForEllipse(width, height, x, y);
      }

      function xmlToJson(data) {
        const parser = new DOMParser();
        let xml = data;
        if (typeof data === "string") {
          xml = parser.parseFromString(data, "text/xml");
        }

        // Create the return object
        var obj = {};

        if (xml.nodeType == 1) { // element
          // do attributes
          if (xml.attributes.length > 0) {
            obj["@attributes"] = {};
            for (var j = 0; j < xml.attributes.length; j++) {
              var attribute = xml.attributes.item(j);
              obj["@attributes"][attribute.nodeName] = attribute.nodeValue;
            }
          }
        } else if (xml.nodeType == 3) { // text
          obj = xml.nodeValue;
        }

        // do children
        if (xml.hasChildNodes()) {
          for (var i = 0; i < xml.childNodes.length; i++) {
            var item = xml.childNodes.item(i);
            var nodeName = item.nodeName;
            if (typeof(obj[nodeName]) == "undefined") {
              obj[nodeName] = xmlToJson(item);
            } else {
              if (typeof(obj[nodeName].push) == "undefined") {
                var old = obj[nodeName];
                obj[nodeName] = [];
                obj[nodeName].push(old);
              }
              obj[nodeName].push(xmlToJson(item));
            }
          }
        }
        return obj;
      };

      function base64ToArrayBuffer(base64String) {
        const binary_string = window.atob(base64String);
        const len = binary_string.length;
        const bytes = new Uint8Array(len);
        for (let i = 0; i < len; i++) {
          bytes[i] = binary_string.charCodeAt(i);
        }
        return bytes.buffer;
      }

      // Color can be of two types: string (if it's static) or object (if it's animated so it's splitted to rgba)
      function colorToCssString(obj) {
        if (typeof obj === "object") {
          // It's been parsed to r-g-b-a object
          return "rgba(" + obj.r + ", " + obj.g + ", " + obj.b + ", " + obj.a + ")";
        }

        // It's normal hex value
        return obj;
      }

      function buildCssGradient(color) {
        const {
          gradientType,
          degree,
          colorStops
        } = color;

        const firstParam = gradientType === 'linear' ? `${180 + degree}deg` : 'circle';
        const cssGradientType = gradientType === 'linear' ? 'linear-gradient' : 'radial-gradient';

        if (colorStops.length === 0) {
          return;
        }

        if (colorStops.length === 1) {
          return colorStops[0].color;
        }

        // Must slice to avoid mutation of original array
        const orderedColors = colorStops.slice().sort((a, b) => a.step - b.step);
        return `${cssGradientType}(${firstParam}, ${orderedColors.map((color) => `${color.color} ${color.step}%`).join(', ')})`;
      }


      function colorToCssString2(color) {
        if (!color.isGradient) {
          return color.color;
        }

        return buildCssGradient(color);
      }


      let storedBrowserVersion;

      function getChromeVersion() {
        if (storedBrowserVersion !== undefined) {
          return storedBrowserVersion;
        }
        const raw = navigator.userAgent.match(/Chrom(e|ium)\/([0-9]+)\./);
        storedBrowserVersion = raw ? parseInt(raw[2], 10) : NaN;

        return storedBrowserVersion;
      }

      const defaultCss = {
        filterBlur: 0,
        filterBrightness: 1,
        filterContrast: 1,
        filterGrayscale: 0,
        filterHueRotate: 0,
        filterInvert: 0,
        filterSaturate: 1,
        filterSepia: 0,
        filterDropShadowX: 0,
        filterDropShadowY: 0,
        filterDropShadowBlur: 0,
        filterDropShadowColor: "#000",
      };

      function update(data) {
        loopic.flags.update = true;

        if (!data) {
          console.log("No template data");
          return;
        }

        try {
          let jsonData = JSON.parse(data);

          for (const id in jsonData) {
            const value = jsonData[id];
            loopic.templateData[id] = value;

            try {
              loopic.fireUpdateItem(id, value, 0);
            } catch (error) {
              console.error("Error while updating item '" + id + "' with value '" + value + "'", error);
            }
          }

        } catch (error) {
          const xmlAsJson = xmlToJson(data);

          if (!xmlAsJson.templateData) {
            console.log("No parsed XML template data");
            return;
          }

          let cData = xmlAsJson.templateData.componentData;
          if (!cData) {
            console.log("No parsed XML component data");
            return;
          }
          if (!Array.isArray(cData)) {
            cData = [cData];
          }

          for (const compData of cData) {
            const id = compData["@attributes"].id;
            const value = compData.data["@attributes"].value;
            loopic.templateData[id] = value;
          }

          for (const compData of cData) {
            const id = compData["@attributes"].id;
            const value = compData.data["@attributes"].value;

            try {
              loopic.fireUpdateItem(id, value, 0);
            } catch (error) {
              console.error("Error while updating item '" + id + "' with value '" + value + "'", error);
            }
          }
        }
      }

      window.SPXGCTemplateDefinition = {
        "description": "EventLocator",

    <script>
      function waitForDomToRender(t) {
        return new Promise((resolve) => setTimeout(resolve, 0));
      }

      const compositionPrototype = {
        compute: function() {
          this.layers.forEach(layer => {
            function computeAllElementProperties(element) {
              Object.entries(element.style).forEach(([key, property]) => {
                property.compute();
              });
            }

            computeAllElementProperties(layer.element);

            if (["PATH"].includes(layer.element.type) && layer.element.points) {
              layer.element.points.forEach(point => {
                point.mainPoint.x.compute();
                point.mainPoint.y.compute();
              })
            }

            layer.maskLayers.forEach(mask => {
              if (mask.element.type === "PATH") {
                mask.element.points.forEach(point => {
                  point.mainPoint.x.compute();
                  point.mainPoint.y.compute();
                });
              } else if (mask.element.type === "RECTANGLE") {
                computeAllElementProperties(mask.element);
              } else if (mask.element.type === "ELLIPSE") {
                computeAllElementProperties(mask.element);
              }
            });

            // Compute all nested compositions
            if (layer.element.type === "COMPOSITION") {
              layer.element.composition.compute();
              layer.element.composition.refreshRender();
            }

          });
          this.isComputed = true;

        },

        checkIfPlayingPossible: function(reverse) {
          if (!reverse) {
            return this.activeFrame < this.duration - 1;
          }
          return this.activeFrame > 0;
        },

        checkIfOnLastFrame: function() {
          if (!this.playInReverse) {
            return this.activeFrame === this.duration - 1;
          }
          return this.activeFrame === 0;
        },

        play: function(arg) {
          let newPlayInReverse = false;
          if (arg && arg.reverse !== undefined) {
            newPlayInReverse = arg.reverse;
          }
          this.playInReverse = newPlayInReverse;

          if (this.isPlaying || !this.checkIfPlayingPossible(this.playInReverse)) {
            return;
          }

          this.isPlaying = true;
          this.show();

          this.playNestedComps();

          if (!this.isComputed) {
            this.compute();
          }

          let now, then = 0,
            elapsed;
          let fpsInterval = 1000 / this.fps,
            startTime;
          let stopped = true;


          const animateCb = async function() {
            if (!this.isPlaying) {
              return;
            }

            now = Date.now();
            elapsed = now - then;

            if (elapsed > fpsInterval) {
              then = now - (elapsed % fpsInterval);

              if (!this.playInReverse) {
                ++this.activeFrame;
              } else {
                --this.activeFrame;
              }

              this.refreshRender();

              await waitForDomToRender();
              await this.executeFrameActions();
              this.playNestedComps();
            }

            // Waiting for action to complete
            setTimeout(() => {

              if (this.checkIfPlayingPossible(this.playInReverse)) {
                // If playing is possible, continue playing
                if (this.isPlaying) {
                  window.requestAnimationFrame(animateCb);
                }

              } else if (this.checkIfOnLastFrame()) {
                // If main composition is still on the last frame after execution of all frame actions, clear it
                if (this === mainComposition) {
                  // If on the last frame and if still playing (after executing actions), then it's done
                  if (this.checkIfOnLastFrame() && this.isPlaying) {
                    this.hide();
                    this.activeFrame = -1;
                    this.pause(); // Mark as paused, so that it can be played again
                  }
                } else {
                  // Pause last frame for nested detached compositions
                  this.pause();
                }

              } else {
                this.pause();
              }
            }, 0);

          }.bind(this);

          animateCb();
        },

        playNestedComps: function() {
          this.layers.forEach(layer => {
            if (layer.element.type === "COMPOSITION" && layer.startFrame <= this.activeFrame) {
              if (!layer.element.detachPlayhead) {
                layer.element.composition.goTo(this.activeFrame - layer.startFrame);
              } else if (layer.element.detachPlayhead && layer.element.autoPlay) {
                layer.element.composition.play();
              }
            }
          });
        },

        pause: function() {
          this.isPlaying = false;
          this.pauseNestedComps();
        },

        pauseNestedComps: function() {
          this.layers.forEach(layer => {
            if (layer.element.type === "COMPOSITION" && !layer.element.detachPlayhead) {
              layer.element.composition.pause();
            }
          });
        },

        show: function() {
          this.domNode.classList.remove("hidden");
        },

        hide: function() {
          this.domNode.classList.add("hidden");
        },

        clear: function() {
          console.log("Clearing template");
          if (window.remove) {
            window.remove();
          }
        },

        goTo: async function(frame) {
          if (frame < 0) {
            this.activeFrame = 0;
          } else {
            this.activeFrame = frame;
          }

          this.goToNestedComps(frame);
          this.refreshRender();

          await waitForDomToRender();
          await this.executeFrameActions();
        },

        goToNestedComps: function(frame) {
          this.layers.forEach(layer => {
            if (layer.element.type === "COMPOSITION" && !layer.element.detachPlayhead) {
              layer.element.composition.goTo(this.activeFrame - layer.startFrame);
            }
          });
        },

        goToAndPlay: function(frame, playArg) {
          this.goTo(frame);
          this.play(playArg);
        },

        findElementByKey: function(key) {
          const splitted = key.split(".");
          const mainKey = splitted[0];
          splitted.shift();
          const nestedKey = splitted.join(".");

          for (const layer of this.layers) {
            if (layer.element.key === mainKey) {
              if (!nestedKey) {
                return layer.element;
              } else if (nestedKey && layer.element.composition) {
                const found = layer.element.composition.findElementByKey(nestedKey);
                if (found) return found;
              }
            }
          }

          for (const layer of this.layers) {
            if (layer.element.composition) {
              const found = layer.element.composition.findElementByKey(key);
              if (found) {
                return found;
              }
            }
          }

        },

        refreshRender: function() {
          for (const layer of this.layers) {
            const layerFrame = this.activeFrame - layer.startFrame;

            if (layer.startFrame > this.activeFrame || layer.startFrame + layer.duration < this.activeFrame || layer.isVisible === false) {
              layer.domNode.classList.add("hidden");
            } else {
              layer.domNode.classList.remove("hidden");
            }

            const cfv = function(property, frameOffset) {
              return property.getValueAtFrame(frameOffset !== undefined ? layerFrame + frameOffset : layerFrame);
            }.bind(this);

            const element = layer.element;
            const props = element.style;

            // Transform and Scale
            const elementX = cfv(props.x);
            const elementY = cfv(props.y);
            const elementScaleX = cfv(props.scaleX);
            const elementScaleY = cfv(props.scaleY);

            const elementWidth = cfv(props.width);
            const elementHeight = cfv(props.height);
            const elementTransformOriginX = element.transformOrigin.x;

      const endTime = performance.now();
      const totalTime = endTime - startTime;
      const msg = "Rendering duration: " + totalTime + "ms";
      if (totalTime > 1000) console.log(msg);

      function setInitialCompositionData(composition) {
        composition.layers.forEach(layer => {
          if (layer.element.type === "COMPOSITION") {
            setInitialCompositionData(layer.element.composition);
          }

          if (layer.element.type === "TEXT") {
            layer.element.setContent(layer.element.content);
          }
        });
      }

      window.onload = function() {
        function ready() {
          setInitialCompositionData(mainComposition);
        }

        function checkReady() {
          if (document.readyState === "complete") {
            ready();
          } else {
            setTimeout(checkReady, 0);
          }
        }
        checkReady();
      };

      mainComposition.refreshRender();
      mainComposition.refreshRenderNestedComps();
      mainComposition.executeCompositionAction();

      function fitToWindow() {
        const windowWidth = innerWidth;
        const windowHeight = innerHeight;
        const compositionWidth = 1920;
        const compositionHeight = 1080;

        const w = windowWidth / compositionWidth;
        const h = windowHeight / compositionHeight;

        const moreToScale = w < h ? w : h;

        const newWidth = compositionWidth * moreToScale;
        const newHeight = compositionHeight * moreToScale;

        const diffWidth = compositionWidth - newWidth;
        const diffHeight = compositionHeight - newHeight;
        const leftShift = diffWidth / 2;
        const topShift = diffHeight / 2;

        const renderEl = document.getElementById("render");
        renderEl.style.transform = "scale(" + moreToScale + ")";
        renderEl.style.position = "fixed";

        renderEl.style.left = -leftShift + "px";
        renderEl.style.top = -topShift + "px";
      }
      fitToWindow();
